import React from 'react'
import { Steps } from 'antd';
import { Card } from 'antd'
import { ExclamationCircleOutlined, SolutionOutlined, LoadingOutlined, SmileOutlined } from '@ant-design/icons';

const { Step } = Steps;

const Dashboard = () => {

  return (
    <Card>
        <Steps size="small">
          <Step status="process" icon={<ExclamationCircleOutlined style={{ color: 'red' }} />} subTitle="Pending" />
          <Step status="process" title="Verification" icon={<SolutionOutlined />} />
          <Step status="process" title="Pay" icon={<LoadingOutlined />} />
          <Step status="process" title="Done" icon={<SmileOutlined />} />
          <Step status="process"subTitle="Login" />
          <Step status="process" title="Verification" icon={<SolutionOutlined />} />
          <Step status="process" title="Pay" icon={<LoadingOutlined />} />
          <Step status="process" title="Done" icon={<SmileOutlined />} />
        </Steps>
    </Card>
  )
}

export default Dashboard

